import React from "react";

export default function Image(){

    let Style = {
        backgroundImage: "url('bgImage.jpg')",
        padding: "350px 85% 350px 0px",
        color: "white",
        fontSize: "72px",
    }
    return (
        <div style = {Style}>
            <ul>
                <li>Free Medical Camps</li>
                <li>Blood Donation Camps</li>
                <li>Free Ayurvedic Dispensary</li>
                <li>750+ Vaids</li>
            </ul>
        </div>
    )
}
